import React from 'react';
import { View, Text, Image, StyleSheet, TouchableOpacity, Dimensions } from 'react-native';

interface Track {
  id: string;
  title: string;
  artist: string;
  duration: string;
  spotifyId?: string;
  previewUrl?: string;
}

interface ReleaseCardProps {
  title: string;
  artist: string;
  artwork: string;
  releaseDate: string;
  genre: string;
  beatportLink?: string;
  spotifyLink?: string;
  tracks: Track[];
  label: 'records' | 'tech' | 'deep';
  isLatestRelease?: boolean;
}

const ReleaseCard: React.FC<ReleaseCardProps> = ({
  title,
  artist,
  artwork,
  releaseDate,
  genre,
  beatportLink,
  spotifyLink,
  tracks,
  label,
  isLatestRelease = false,
}) => {
  const labelColors = {
    records: '#ff4081',
    tech: '#00ff00',
    deep: '#4a90e2',
  };

  const formattedDate = new Date(releaseDate).toLocaleDateString('en-US', {
    year: 'numeric',
    month: 'short',
    day: 'numeric',
  });

  if (isLatestRelease) {
    return (
      <TouchableOpacity style={styles.latestContainer}>
        <View style={styles.latestContent}>
          <View style={styles.latestImageContainer}>
            <Image
              source={{ uri: artwork }}
              style={styles.latestArtwork}
            />
            <View style={[styles.latestBadge, { backgroundColor: labelColors[label] }]}>
              <Text style={styles.latestBadgeText}>Latest Release</Text>
            </View>
          </View>

          <View style={styles.latestInfoContainer}>
            <View style={styles.latestHeaderContainer}>
              <View style={styles.latestTitleContainer}>
                <Text style={styles.latestTitle}>{title}</Text>
                <Text style={styles.latestArtist}>{artist}</Text>
                <Text style={styles.latestDetails}>{genre} • {formattedDate}</Text>
              </View>
              <View style={styles.latestButtonsContainer}>
                {beatportLink && (
                  <TouchableOpacity
                    style={[styles.latestButton, { backgroundColor: labelColors[label] }]}
                  >
                    <Text style={styles.latestButtonText}>BP</Text>
                  </TouchableOpacity>
                )}
                {spotifyLink && (
                  <TouchableOpacity
                    style={[styles.latestButton, { backgroundColor: '#1DB954' }]}
                  >
                    <Text style={styles.latestButtonText}>SP</Text>
                  </TouchableOpacity>
                )}
              </View>
            </View>

            <View style={styles.tracksContainer}>
              {tracks.slice(0, 3).map((track) => (
                <Text key={track.id} style={styles.trackInfo}>
                  {track.title} ({track.duration})
                </Text>
              ))}
            </View>
          </View>
        </View>
      </TouchableOpacity>
    );
  }

  return (
    <TouchableOpacity style={styles.priorContainer}>
      <Image
        source={{ uri: artwork }}
        style={styles.priorArtwork}
      />
      <View style={styles.priorInfoContainer}>
        <View style={styles.priorTextContainer}>
          <Text style={styles.priorTitle}>{title}</Text>
          <Text style={styles.priorArtist}>{artist}</Text>
          <Text style={styles.priorDetails}>{formattedDate} • {genre}</Text>
        </View>
        <View style={styles.priorButtonsContainer}>
          {beatportLink && (
            <TouchableOpacity
              style={[styles.priorButton, { backgroundColor: labelColors[label] }]}
            >
              <Text style={styles.priorButtonText}>BP</Text>
            </TouchableOpacity>
          )}
          {spotifyLink && (
            <TouchableOpacity
              style={[styles.priorButton, { backgroundColor: '#1DB954' }]}
            >
              <Text style={styles.priorButtonText}>SP</Text>
            </TouchableOpacity>
          )}
        </View>
      </View>
    </TouchableOpacity>
  );
};

const styles = StyleSheet.create({
  // Latest Release Styles
  latestContainer: {
    backgroundColor: '#1E1E1E',
    borderRadius: 8,
    overflow: 'hidden',
  },
  latestContent: {
    flexDirection: 'row',
    height: 180,
  },
  latestImageContainer: {
    position: 'relative',
    width: 180,
    height: 180,
  },
  latestArtwork: {
    width: '100%',
    height: '100%',
  },
  latestBadge: {
    position: 'absolute',
    top: 10,
    right: 10,
    paddingHorizontal: 12,
    paddingVertical: 6,
    borderRadius: 4,
  },
  latestBadgeText: {
    color: '#FFFFFF',
    fontSize: 12,
    fontWeight: 'bold',
  },
  latestInfoContainer: {
    flex: 1,
    padding: 15,
    justifyContent: 'space-between',
  },
  latestHeaderContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  latestTitleContainer: {
    flex: 1,
    marginRight: 10,
  },
  latestTitle: {
    color: '#FFFFFF',
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 4,
  },
  latestArtist: {
    color: '#BBBBBB',
    fontSize: 14,
    marginBottom: 4,
  },
  latestDetails: {
    color: '#888888',
    fontSize: 12,
  },
  latestButtonsContainer: {
    flexDirection: 'row',
    gap: 6,
  },
  latestButton: {
    width: 32,
    height: 32,
    borderRadius: 16,
    justifyContent: 'center',
    alignItems: 'center',
  },
  latestButtonText: {
    color: '#FFFFFF',
    fontSize: 11,
    fontWeight: 'bold',
  },
  tracksContainer: {
    marginTop: 10,
  },
  trackInfo: {
    color: '#BBBBBB',
    fontSize: 12,
    marginBottom: 2,
  },

  // Prior Release Styles
  priorContainer: {
    backgroundColor: '#1E1E1E',
    borderRadius: 8,
    overflow: 'hidden',
    marginBottom: 10,
    flexDirection: 'row',
    height: 80,
  },
  priorArtwork: {
    width: 80,
    height: 80,
  },
  priorInfoContainer: {
    flex: 1,
    flexDirection: 'row',
    justifyContent: 'space-between',
    padding: 10,
  },
  priorTextContainer: {
    flex: 1,
    justifyContent: 'center',
  },
  priorTitle: {
    color: '#FFFFFF',
    fontSize: 14,
    fontWeight: 'bold',
    marginBottom: 2,
  },
  priorArtist: {
    color: '#BBBBBB',
    fontSize: 12,
    marginBottom: 2,
  },
  priorDetails: {
    color: '#888888',
    fontSize: 11,
  },
  priorButtonsContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    gap: 6,
    marginLeft: 10,
  },
  priorButton: {
    width: 32,
    height: 32,
    borderRadius: 16,
    justifyContent: 'center',
    alignItems: 'center',
  },
  priorButtonText: {
    color: '#FFFFFF',
    fontSize: 11,
    fontWeight: 'bold',
  },
});

export default ReleaseCard;
